import { Provider } from 'react-redux';

let rerenderEntireTree = () => {
  ReactDOM.render(
    <BrowserRouter>
      <Provider store = {store}>
        <App />
      </Provider>
    </BrowserRouter>, document.getElementById('root'));
}



